	(9,'<p style=\"margin-top: 0px; margin-bottom: 24px; box-sizing: border-box; outline: 0px; padding: 0px; line-height: 32px; text-align: justify; color: rgb(74, 74, 74); word-break: break-word; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, Helvetica, &quot;Hiragino Sans GB&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">苹果<a href=\"https://www.chinaz.com/tags/iPhone12ProMax.shtml\" target=\"_blank\" style=\"box-sizing: border-box; outline: 0px; color: rgb(66, 66, 66); text-decoration-line: none; padding: 0px 0px 2px; border-bottom: 1px dashed rgb(51, 51, 51); cursor: pointer;\">iPhone12ProMax</a>是今年苹果性能配置最强的一个型号，也因此成为很多人打算购买的一款手机，那么这款手机在什么时候会发售上市呢，线下门店什么时候能买到，我们来一起看下具体的时间介绍吧。</p><p class=\"article-content__img\" style=\"margin-top: 0px; margin-bottom: 24px; box-sizing: border-box; outline: 0px; padding: 0px; line-height: 32px; text-align: center; color: rgb(74, 74, 74); word-break: break-word; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, Helvetica, &quot;Hiragino Sans GB&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; display: flex; -webkit-box-align: center; align-items: center; -webkit-box-pack: center; justify-content: center; white-space: normal; background-color: rgb(255, 255, 255);\"><img src=\"https://upload.chinaz.com/2020/1105/6374018479209622675668582.jpg\" title=\"苹果.jpg\" alt=\"苹果.jpg\" style=\"display: inline-block; box-sizing: border-box; outline: 0px; border: 1px solid rgb(238, 238, 238); max-width: 800px; background: url(&quot;../img/bglogo2.svg&quot;) center center no-repeat rgb(247, 248, 249); box-shadow: rgba(27, 95, 160, 0.1) 0px 1px 3px; margin: 0px auto;\"/></p><p style=\"margin-top: 0px; margin-bottom: 24px; box-sizing: border-box; outline: 0px; padding: 0px; line-height: 32px; text-align: justify; color: rgb(74, 74, 74); word-break: break-word; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, Helvetica, &quot;Hiragino Sans GB&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">1、iPhone12ProMax发售时间:11月6日晚上9点开启预售，11月13日正式发售上市</p><p style=\"margin-top: 0px; margin-bottom: 24px; box-sizing: border-box; outline: 0px; padding: 0px; line-height: 32px; text-align: justify; color: rgb(74, 74, 74); word-break: break-word; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, Helvetica, &quot;Hiragino Sans GB&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">2、如果在11月6日第一时间预约的用户，那么有机会在11月13日当天就可以发货，或者在苹果直营店取货</p><p style=\"margin-top: 0px; margin-bottom: 24px; box-sizing: border-box; outline: 0px; padding: 0px; line-height: 32px; text-align: justify; color: rgb(74, 74, 74); word-break: break-word; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, Helvetica, &quot;Hiragino Sans GB&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">3、iPhone12ProMax价格:9299元（128GB）、10099元(256GB)、11899元(512GB)</p><p style=\"margin-top: 0px; margin-bottom: 24px; box-sizing: border-box; outline: 0px; padding: 0px; line-height: 32px; text-align: justify; color: rgb(74, 74, 74); word-break: break-word; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, Helvetica, &quot;Hiragino Sans GB&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">4、iPhone12ProMax预计会十分热销，尤其是256GB、512GB的版本有可能出现加价的情况，另外海蓝色和石墨色两个颜色也会比较多人购买</p><p style=\"margin-top: 0px; margin-bottom: 24px; box-sizing: border-box; outline: 0px; padding: 0px; line-height: 32px; text-align: justify; color: rgb(74, 74, 74); word-break: break-word; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, Helvetica, &quot;Hiragino Sans GB&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">5、建议在11月6日晚上9点准时就前往官网下单付款，预计最快可以在发售日当天可以取货，如果速度较慢的话，可能需要等到超过1-2周时间才发货</p><p><br style=\"white-space: normal;\"/></p><p><br style=\"white-space: normal;\"/></p><p><br/></p>',2,16),
